import Card from 'react-bootstrap/Card';

const Link = props => {
    return (
        <Card bg="warning" key="1" text="black" style={{ width: '18rem' }} className="mb-2">
            <Card.Body>

                <Card.Link href={props.url}>
                    {
                    props.text}
                    </Card.Link>
            </Card.Body>
        </Card>)
}

export default Link;
